import './featured.scss'

const Featured = () => {
    return (
        <div className="featured">
            <img src="https://m.media-amazon.com/images/I/71iuK7PVlZL._SL1414_.jpg" alt="salvation"/>

            <div className="info">
                
                <span>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Illum nulla labore, molestiae natus excepturi repellat ipsam perferendis quibusdam aperiam quos ea, sit suscipit magni distinctio iste impedit error qui saepe!</span>
            </div>
        </div>
    )
}

export default Featured
